import actionTypes from "./actionTypes";
import { getAllCodeService } from "../../services/userServices";

// export const fetchGenderStart = () => ({
//     type: actionTypes.FETCH_GENDER_START,
// })
export const fetchGenderStart = async (dispatch, getState) => {
    try {
        let res = await getAllCodeService('gender');
        if(res && res.data.errCode === 0){
            fetchGenderSuccess(res.data.data)
        }else{
            fetchGenderFailed(res.data.errMess)
        }
    } catch (error) {
        fetchGenderFailed();
        console.log("fetchGenderStart error", error);
    }
};
export const fetchGenderSuccess = (gender) => ({
    type: actionTypes.FETCH_GENDER_SUCCESS,
});
export const fetchGenderFailed = () => ({
    type: actionTypes.FETCH_GENDER_FAILED,
});
